INSERT INTO `viid_workflow` VALUES ('327614447551016966', '机动车转百诚对象并上传RabbitMQ流程', '[\"13\"]', 'DISABLED', '机动车转百诚对象并上传RabbitMQ流程', '{\"nodes\":[{\"id\":\"start_0\",\"type\":\"start\",\"meta\":{\"position\":{\"x\":180,\"y\":89.5}},\"data\":{\"title\":\"Start\",\"outputs\":{\"type\":\"object\",\"properties\":{\"inputs\":{\"type\":\"string\",\"default\":\"Hello Flow.\"}},\"required\":[\"inputs\"]}}},{\"id\":\"end_0\",\"type\":\"end\",\"meta\":{\"position\":{\"x\":1560,\"y\":89.5}},\"data\":{\"title\":\"End\",\"inputsValues\":{\"output\":{\"type\":\"ref\",\"content\":[\"rabbitmq_3c8kV\",\"msg\"],\"extra\":{\"index\":0}}},\"inputs\":{\"type\":\"object\",\"properties\":{\"output\":{\"type\":\"object\"}}}}},{\"id\":\"rabbitmq_3c8kV\",\"type\":\"rabbitmq\",\"meta\":{\"position\":{\"x\":1100,\"y\":0}},\"data\":{\"title\":\"Rabbitmq_1\",\"inputsValues\":{\"ip\":{\"type\":\"constant\",\"content\":\"127.0.0.1\",\"schema\":{\"type\":\"string\"}},\"port\":{\"type\":\"constant\",\"content\":5672},\"username\":{\"type\":\"constant\",\"content\":\"xxx\"},\"password\":{\"type\":\"constant\",\"content\":\"xxx\",\"schema\":{\"type\":\"string\"}},\"exchange\":{\"type\":\"constant\",\"content\":\"BCHT_ITS_DATA\"},\"routingKey\":{\"type\":\"constant\",\"content\":\"BaiChengMotorVehicle\"},\"msg\":{\"type\":\"ref\",\"content\":[\"code_1\",\"baiChengVehicle\"]}},\"inputs\":{\"type\":\"object\",\"required\":[\"ip\",\"port\",\"username\",\"password\",\"exchange\",\"routingKey\"],\"properties\":{\"ip\":{\"type\":\"string\"},\"port\":{\"type\":\"number\"},\"username\":{\"type\":\"string\"},\"password\":{\"type\":\"string\"},\"exchange\":{\"type\":\"string\"},\"routingKey\":{\"type\":\"string\"},\"msg\":{\"type\":\"object\"}}},\"outputs\":{\"type\":\"object\",\"properties\":{\"msg\":{\"type\":\"object\"}},\"required\":[\"msg\"]}}},{\"id\":\"code_1\",\"type\":\"code\",\"meta\":{\"position\":{\"x\":640,\"y\":0}},\"data\":{\"title\":\"ConvertToBaiCheng\",\"inputsValues\":{\"inputs\":{\"type\":\"ref\",\"content\":[\"start_0\",\"inputs\"],\"extra\":{\"index\":0}}},\"script\":{\"language\":\"javascript\",\"content\":\"log.info(\\\"Converting motor vehicle data to BaiCheng format: {}\\\", inputs);\\n\\n// Parse the input JSON string to an object\\nvar motorVehicle = JSON.parse(inputs);\\n\\n// 车牌颜色转换逻辑\\n// 视图库车牌颜色字典:\\n// 1 黑, 2 白, 3 灰, 4 红, 5 蓝, 6 黄, 7 橙, 8 棕, 9 绿, 10 紫, 11 青, 12 粉, 13 透明, 99 其他\\n// 百诚颜色字典:\\n// 0-白色，1-黄色，2-蓝色，3-黑色，4-绿色，5-未识别，9-其他颜色\\nfunction convertPlateColor(viewLibColor) {\\n    var colorMap = {\\n        \\\"1\\\": \\\"3\\\",   // 黑 -> 黑色\\n        \\\"2\\\": \\\"0\\\",   // 白 -> 白色\\n        \\\"3\\\": \\\"9\\\",   // 灰 -> 其他颜色\\n        \\\"4\\\": \\\"9\\\",   // 红 -> 其他颜色\\n        \\\"5\\\": \\\"2\\\",   // 蓝 -> 蓝色\\n        \\\"6\\\": \\\"1\\\",   // 黄 -> 黄色\\n        \\\"7\\\": \\\"9\\\",   // 橙 -> 其他颜色\\n        \\\"8\\\": \\\"9\\\",   // 棕 -> 其他颜色\\n        \\\"9\\\": \\\"4\\\",   // 绿 -> 绿色\\n        \\\"10\\\": \\\"9\\\",  // 紫 -> 其他颜色\\n        \\\"11\\\": \\\"9\\\",  // 青 -> 其他颜色\\n        \\\"12\\\": \\\"9\\\",  // 粉 -> 其他颜色\\n        \\\"13\\\": \\\"9\\\",  // 透明 -> 其他颜色\\n        \\\"99\\\": \\\"9\\\"   // 其他 -> 其他颜色\\n    };\\n    return colorMap[viewLibColor] || \\\"5\\\";  // 默认返回未识别\\n}\\n\\n// 车身颜色转换逻辑\\n// 视图库车身颜色字典:\\n// 1 黑, 2 白, 3 灰, 4 红, 5 蓝, 6 黄, 7 橙, 8 棕, 9 绿, 10 紫, 11 青, 12 粉, 13 透明, 99 其他\\n// 百诚车身颜色字典:\\n// A-白,B-灰,C-黄,D-粉,E-红,F-紫,G-绿,H-蓝,I-棕,J-黑\\nfunction convertVehicleColor(viewLibColor) {\\n    var colorMap = {\\n        \\\"1\\\": \\\"J\\\",   // 黑 -> 黑\\n        \\\"2\\\": \\\"A\\\",   // 白 -> 白\\n        \\\"3\\\": \\\"B\\\",   // 灰 -> 灰\\n        \\\"4\\\": \\\"E\\\",   // 红 -> 红\\n        \\\"5\\\": \\\"H\\\",   // 蓝 -> 蓝\\n        \\\"6\\\": \\\"C\\\",   // 黄 -> 黄\\n        \\\"7\\\": \\\"9\\\",   // 橙 -> 其他\\n        \\\"8\\\": \\\"I\\\",   // 棕 -> 棕\\n        \\\"9\\\": \\\"G\\\",   // 绿 -> 绿\\n        \\\"10\\\": \\\"F\\\",  // 紫 -> 紫\\n        \\\"11\\\": \\\"9\\\",  // 青 -> 其他\\n        \\\"12\\\": \\\"D\\\",  // 粉 -> 粉\\n        \\\"13\\\": \\\"9\\\",  // 透明 -> 其他\\n        \\\"99\\\": \\\"9\\\"   // 其他 -> 其他\\n    };\\n    return colorMap[viewLibColor] || \\\"9\\\";  // 默认返回其他\\n}\\n\\nvar baiChengPlateColor = convertPlateColor(motorVehicle.PlateColor);\\nvar baiChengVehicleColor = convertVehicleColor(motorVehicle.VehicleColor);\\n\\n// Create BaiCheng motor vehicle object\\nvar baiChengVehicle = {\\n    gcbh: motorVehicle.MotorVehicleID,\\n    sbbh: motorVehicle.DeviceID || \\\"\\\",\\n    sbxh: motorVehicle.DeviceID || \\\"\\\",\\n    jgsjStr: motorVehicle.PassTime || motorVehicle.CaptureTime || \\\"\\\",\\n    hphm: motorVehicle.PlateNo || \\\"\\\",\\n    hpzl: motorVehicle.PlateClass || \\\"\\\",\\n    hpys: baiChengPlateColor,\\n    cwkc: parseFloat(motorVehicle.VehicleLength) || 0,\\n    clys: baiChengVehicleColor,\\n    cllx: motorVehicle.VehicleClass || \\\"\\\",\\n    sd: parseFloat(motorVehicle.Speed) || 0,\\n    cdbh: parseInt(motorVehicle.LaneNo) || 0,\\n    fx: motorVehicle.Direction || \\\"\\\",\\n    cid: motorVehicle.CID || \\\"\\\",\\n    tid: motorVehicle.TID || \\\"\\\",\\n    tpurl: motorVehicle.StorageUrl1 || \\\"\\\",\\n    tpurl1: motorVehicle.StorageUrl2 || \\\"\\\",\\n    tpurl2: motorVehicle.StorageUrl3 || \\\"\\\"\\n};\\n\\nlog.info(\\\"Converted to BaiCheng format: {}\\\", JSON.stringify(baiChengVehicle));\\n\\n// Return the converted object\\nvar result = {\\n    baiChengVehicle: baiChengVehicle\\n};\\nresult;\"},\"outputs\":{\"type\":\"object\",\"properties\":{\"baiChengVehicle\":{\"type\":\"object\"}},\"required\":[\"baiChengVehicle\"]},\"inputs\":{\"type\":\"object\",\"properties\":{\"inputs\":{\"type\":\"string\"}}}}}],\"edges\":[{\"sourceNodeID\":\"start_0\",\"targetNodeID\":\"code_1\"},{\"sourceNodeID\":\"code_1\",\"targetNodeID\":\"rabbitmq_3c8kV\"},{\"sourceNodeID\":\"rabbitmq_3c8kV\",\"targetNodeID\":\"end_0\"}]}', NULL, NULL, NULL, NULL);
INSERT INTO `viid_workflow` VALUES ('328276760200690817', '高德地图地点搜索并写入文件', '[\"901\"]', 'DISABLED', '从高德地图API获取地点信息并写入txt文件', '{\"nodes\":[{\"id\":\"start_0\",\"type\":\"start\",\"meta\":{\"position\":{\"x\":180,\"y\":89.5}},\"data\":{\"title\":\"Start\",\"outputs\":{\"type\":\"object\",\"properties\":{\"key\":{\"type\":\"string\",\"default\":\"\",\"description\":\"高德Key\"},\"keywords\":{\"type\":\"string\",\"default\":\"来优品\",\"description\":\"地点关键字\"},\"filePath\":{\"type\":\"string\",\"extra\":{\"index\":3},\"description\":\"写文件路径\"},\"region\":{\"type\":\"string\",\"extra\":{\"index\":4},\"description\":\"行政区划编码，多个使用逗号分隔\"}},\"required\":[\"key\",\"keywords\",\"filePath\",\"region\"]}}},{\"id\":\"end_0\",\"type\":\"end\",\"meta\":{\"position\":{\"x\":1100,\"y\":89.5}},\"data\":{\"title\":\"End\",\"inputsValues\":{},\"inputs\":{\"type\":\"object\",\"properties\":{}}}},{\"id\":\"code_GCIN1\",\"type\":\"code\",\"meta\":{\"position\":{\"x\":640,\"y\":0}},\"data\":{\"title\":\"Code_1\",\"inputsValues\":{\"key\":{\"type\":\"ref\",\"content\":[\"start_0\",\"key\"],\"extra\":{\"index\":0}},\"keywords\":{\"type\":\"ref\",\"content\":[\"start_0\",\"keywords\"],\"extra\":{\"index\":1}},\"filePath\":{\"type\":\"ref\",\"content\":[\"start_0\",\"filePath\"],\"extra\":{\"index\":2}},\"region\":{\"type\":\"ref\",\"content\":[\"start_0\",\"region\"],\"extra\":{\"index\":3}}},\"script\":{\"language\":\"javascript\",\"content\":\"var HttpUtil = Java.type(\\\"cn.hutool.http.HttpUtil\\\");\\nvar Workbook = Java.type(\\\"org.apache.poi.xssf.usermodel.XSSFWorkbook\\\");\\nvar Sheet = Java.type(\\\"org.apache.poi.xssf.usermodel.XSSFSheet\\\");\\nvar Row = Java.type(\\\"org.apache.poi.xssf.usermodel.XSSFRow\\\");\\nvar Cell = Java.type(\\\"org.apache.poi.xssf.usermodel.XSSFCell\\\");\\nvar FileOutputStream = Java.type(\\\"java.io.FileOutputStream\\\");\\nvar File = Java.type(\\\"java.io.File\\\");\\n\\n// 初始化参数\\nvar pageSize = 10;\\nvar maxPages = 100000;  // 最大循环次数控制，防止无限循环\\nvar allResults = [];\\n\\n// 分割region参数\\nvar regions = region.split(\\\",\\\");\\n\\nfor (var r = 0; r < regions.length; r++) {\\n    var currentRegion = regions[r].trim();\\n    var page = 1;\\n\\n    while (page <= maxPages) {\\n        var url = \\\"https://restapi.amap.com/v5/place/text?key=\\\" + key + \\\"&keywords=\\\" + keywords + \\\"&page_size=\\\" + pageSize + \\\"&page_num=\\\" + page + \\\"&city_limit=true&region=\\\" + currentRegion;\\n        var res = HttpUtil.get(url);\\n\\n        // 解析响应\\n        var response = JSON.parse(res);\\n\\n        // 检查是否有错误\\n        if (response.status !== \\\"1\\\") {\\n            log.error(\\\"API请求失败: {}\\\", response.info);\\n            break;\\n        }\\n\\n        // 获取当前页的数据\\n        var pois = response.pois || [];\\n\\n        // 如果没有更多数据则退出循环\\n        if (pois.length === 0) {\\n            log.info(\\\"已获取所有数据，共 {} 页\\\", page - 1);\\n            break;\\n        }\\n\\n        // 添加到总结果中\\n        allResults = allResults.concat(pois);\\n\\n        log.info(\\\"已获取第 {} 页数据，当前共 {} 条记录\\\", page, allResults.length);\\n\\n        // 增加页码继续下一页\\n        page++;\\n\\n        // 防止API调用过于频繁，可以添加短暂延迟\\n        java.lang.Thread.sleep(1000);\\n    }\\n}\\n\\n// 写入Excel文件\\ntry {\\n    var workbook = new Workbook();\\n    var sheet = workbook.createSheet(\\\"POIs\\\");\\n\\n    // 创建表头\\n    var headerRow = sheet.createRow(0);\\n    var headers = [\\\"id\\\", \\\"name\\\", \\\"type\\\", \\\"typecode\\\", \\\"address\\\", \\\"location\\\", \\\"tel\\\", \\\"distance\\\", \\\"pname\\\", \\\"cityname\\\", \\\"adname\\\", \\\"pcode\\\", \\\"adcode\\\", \\\"citycode\\\"];\\n    for (var i = 0; i < headers.length; i++) {\\n        var cell = headerRow.createCell(i);\\n        cell.setCellValue(headers[i]);\\n    }\\n\\n    // 写入数据\\n    for (var i = 0; i < allResults.length; i++) {\\n        var rowData = allResults[i];\\n        var row = sheet.createRow(i + 1);\\n        row.createCell(0).setCellValue(rowData.id || \\\"\\\");\\n        row.createCell(1).setCellValue(rowData.name || \\\"\\\");\\n        row.createCell(2).setCellValue(rowData.type || \\\"\\\");\\n        row.createCell(3).setCellValue(rowData.typecode || \\\"\\\");\\n        row.createCell(4).setCellValue(rowData.address || \\\"\\\");\\n        row.createCell(5).setCellValue(rowData.location || \\\"\\\");\\n        row.createCell(6).setCellValue(rowData.tel || \\\"\\\");\\n        row.createCell(7).setCellValue(rowData.distance || \\\"\\\");\\n        row.createCell(8).setCellValue(rowData.pname || \\\"\\\");\\n        row.createCell(9).setCellValue(rowData.cityname || \\\"\\\");\\n        row.createCell(10).setCellValue(rowData.adname || \\\"\\\");\\n        row.createCell(11).setCellValue(rowData.pcode || \\\"\\\");\\n        row.createCell(12).setCellValue(rowData.adcode || \\\"\\\");\\n        row.createCell(13).setCellValue(rowData.citycode || \\\"\\\");\\n    }\\n\\n    // 自动调整列宽\\n    for (var i = 0; i < headers.length; i++) {\\n        sheet.autoSizeColumn(i);\\n    }\\n\\n    // 输出文件\\n    var file = new File(filePath);\\n    var outputStream = new FileOutputStream(file);\\n    workbook.write(outputStream);\\n    outputStream.close();\\n    workbook.close();\\n\\n    log.info(\\\"成功写入 {} 条记录到 Excel 文件\\\", allResults.length);\\n} catch (e) {\\n    log.error(\\\"写入 Excel 文件时发生错误: \\\", e);\\n}\\n\\nvar output = {\\n  \\\"dataSize\\\": allResults.length\\n}\\noutput;\\n\\n\"},\"outputs\":{\"type\":\"object\",\"properties\":{\"dataSize\":{\"type\":\"integer\",\"extra\":{\"index\":1}}},\"required\":[\"dataSize\"]},\"inputs\":{\"type\":\"object\",\"properties\":{\"key\":{\"type\":\"string\"},\"keywords\":{\"type\":\"string\"},\"filePath\":{\"type\":\"string\"},\"region\":{\"type\":\"string\"}}}}}],\"edges\":[{\"sourceNodeID\":\"start_0\",\"targetNodeID\":\"code_GCIN1\"},{\"sourceNodeID\":\"code_GCIN1\",\"targetNodeID\":\"end_0\"}]}', NULL, NULL, NULL, NULL);
